
public class ValidPalindrome {
	public boolean validPalindrome(String s) {
		return validPalindrome(s, false, 0, s.length()-1);
    }
	private boolean validPalindrome(String s, boolean skipped, int left, int right) {
		if(right - left < 1)
			return true;
		if(s.charAt(left) == s.charAt(right))
			return validPalindrome(s, skipped, left + 1, right - 1);
		if(!skipped)
			return (validPalindrome(s, true, left + 1, right) 
					|| validPalindrome(s, true, left, right - 1));
        return false;
    }
	public static void main(String[] args) {
		// TODO Auto-generated method stubaa
		ValidPalindrome obj = new ValidPalindrome();
		if(obj.validPalindrome(""))
			System.out.println("True");
		else
			System.out.println("False");
	}

}
